import { Component } from 'react'

class Carousel extends Component {
    constructor(props) {
        super(props)
    }


    render(h) {
        return (
            <div className={'header-carousel-container'}>
                <div className={'previous-button'}> '' </div>
                {this.props.children}
                <div className={'next-button'}></div>
            </div>
        );
    }

}

export default Carousel;
